import React from 'react'
import './release.css';

const Album = ({img, name, artist, date, category}) => {
  return (
    <div className='album-box'>
      <img src={img}/>
      <div className='album-info'>
        <h2 className='text-sparkle'>{name}</h2>
        <p>{artist}</p>
        <p>{date}</p>
        {category ? <p>{category}</p> : <p></p>}   
      </div>  
    </div>
  )
}

export default Album
